import React, { useRef, useEffect, useState } from 'react';

const Header = () => {
  const headerRef = useRef(null);
  const menuRef = useRef(null);
  const [isMenuOpen, setMenuOpen] = useState(false);

  useEffect(() => {
    const stickyHeaderFunc = () => {
      if (
        document.body.scrollTop > 80 ||
        document.documentElement.scrollTop > 80
      ) {
        headerRef.current.classList.add('sticky_header');
      } else {
        headerRef.current.classList.remove('sticky_header');
      }
    };

    window.addEventListener('scroll', stickyHeaderFunc);
    return () => window.removeEventListener('scroll', stickyHeaderFunc);
  }, []);

  const handleClick = (e) => {
    e.preventDefault();
    const targetAttr = e.target.getAttribute('href');
    const targetElement = document.querySelector(targetAttr);

    if (targetElement) {
      const location = targetElement.offsetTop;

      window.scrollTo({
        top: location - 80,
        left: 0,
        behavior: 'smooth',
      });
    }
  };

  const toggleMenu = () => setMenuOpen(!isMenuOpen);

  return (
    <header ref={headerRef} className={`header ${isMenuOpen ? 'menu-open' : ''}`}>
      <div className="container">
        <div className="header-content">
          <div className="logo">
            <span className="logo-circle">AB</span>
            <div className="logo-text">
              <h2>Akshay</h2>
              <p>Balte</p>
            </div>
          </div>
          <div className={`menu ${isMenuOpen ? 'open' : ''}`} ref={menuRef}>
            <ul>
              <li><a href="#home" onClick={handleClick}>Home</a></li>
              <li><a href="#about" onClick={handleClick}>About</a></li>
              <li><a href="#services" onClick={handleClick}>Services</a></li>
              <li><a href="#portfolio" onClick={handleClick}>Portfolio</a></li>
              <li><a href="#contact" onClick={handleClick}>Contact</a></li>
              <li><a href="#skills" onClick={handleClick}>Skills</a></li>
            </ul>
          </div>
          <div className="mobile-menu-icon" onClick={toggleMenu}>
            <i className="ri-menu-line"></i>
          </div>
        </div>
      </div>

      <style jsx>{`
        .header {
          width: 100%;
          height: 80px;
          display: flex;
          align-items: center;
          justify-content: center;
          background: #ffffff;
          transition: background 0.3s ease, box-shadow 0.3s ease;
        }
        .sticky_header {
          background: #333;
          box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
        }
        .container {
          width: 90%;
          max-width: 1200px;
          margin: 0 auto;
          display: flex;
          justify-content: space-between;
          align-items: center;
        }
        .header-content {
          width: 100%;
          display: flex;
          justify-content: space-between;
          align-items: center;
        }
        .logo {
          display: flex;
          align-items: center;
          gap: 10px;
        }
        .logo-circle {
          width: 35px;
          height: 35px;
          background-color: #0056b3;
          color: #ffffff;
          text-align: center;
          line-height: 35px;
          border-radius: 50%;
          font-size: 18px;
          font-weight: 500;
        }
        .logo-text {
          display: flex;
          flex-direction: column;
          align-items: flex-start;
        }
        .logo-text h2 {
          font-size: 24px;
          color: #333;
          margin: 0;
        }
        .logo-text p {
          font-size: 16px;
          color: #666;
          margin: 0;
        }
        .menu {
          display: flex;
          gap: 20px;
          list-style: none;
          margin: 0;
          padding: 0;
        }
        .menu ul {
          display: flex;
          gap: 20px;
        }
        .menu a {
          text-decoration: none;
          color: #333;
          font-size: 16px;
          font-weight: 500;
          transition: color 0.3s ease;
        }
        .menu a:hover {
          color: #0056b3;
        }
        .mobile-menu-icon {
          display: none;
        }
        @media (max-width: 768px) {
          .menu {
            display: none;
            position: absolute;
            top: 80px;
            right: 0;
            background: #ffffff;
            flex-direction: column;
            width: 100%;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
          }
          .menu.open {
            display: flex;
          }
          .mobile-menu-icon {
            display: block;
            font-size: 24px;
            color: #333;
          }
        }
      `}</style>
    </header>
  );
};

export default Header;
